import React from "react";
import { useParams } from 'react-router-dom';

function SchedulePage() {
  const { rows } = useParams(); // Access the rows data from URL parameters
  console.log(rows);
  return (
    <div>
      <h1>Your Schedule </h1>
      <div>
        {rows.map((row, index) => (
          <div key={index}>
            <p>Time: {row.time}</p>
            <p>Task: {row.task}</p>
            <p>Goal: {row.goal}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default SchedulePage;
